<style>
        @font-face {
            font-family: Inter; 
            src: url("./fonts/Inter-Bold.otf") format("opentype");
        }

        @font-face {
            font-family: SVN-Gilroy-800;
            src: url("./fonts/SVN-Gilroy XBold.otf") format('opentype');
        }

        @font-face {
            font-family: SVN-Gilroy-600;
            src: url("./fonts/SVN-Gilroy SemiBold.otf") format('opentype');
        }

        @font-face {
            font-family: SVN-Gilroy-700;
            src: url("./fonts/SVNGilroyBold.otf") format('opentype');
        }

        @font-face {
            font-family: SVN-Gilroy-500;
            src: url("./fonts/SVN-Gilroy Medium.otf") format('opentype');
        }

        .timeIt {
            fill: #FFF;
            font-family: Inter;
            font-size: 14px;
            letter-spacing: -0.28px; 
        }
        .transferSuccess {
            fill: #6AB654;
            font-family: SVN-Gilroy-800;
            font-size: 14px;
        }
        
        .transferAccout {
            fill: #112944;
            font-family: SVN-Gilroy-600;
            font-size: 14px;
        }

        .transferUser {
            fill: #112944;
            font-family: SVN-Gilroy-600;
            font-size: 14px;
        }

        .receiveAccout {
            fill: #112944;
            font-family: SVN-Gilroy-800;
            font-size: 14px;
        }
        
        .receiveUser {
            fill: #112944;
            font-family: SVN-Gilroy-800;
            font-size: 14px;
        }

        .reveiveBank {
            color: #112944;
            text-align: right; 
            font-family: SVN-Gilroy-600;
            font-size: 14px;
            line-height: 18px;
        }

        .transferMoney {
            fill: #24578E;
            font-family: SVN-Gilroy-700;
            font-size: 14px;
        }

        .tranferMoneyText {
            fill: #24578E;
            font-family: SVN-Gilroy-700;
            font-size: 14px;
        }

        .fee {
            fill: #112944;
            font-family: SVN-Gilroy-600;
            font-size: 14px;
        }

        .contentbank {
            color: #112944;
            font-family: SVN-Gilroy-600;
            font-size: 14px;
            line-height: 18px;
            text-align: right; 
        }

        .dateTimeAndTradingcode {
            fill: #6B7C8C;
            font-family: SVN-Gilroy-500;
            font-size: 12px;
            line-height: 12px;
        }

    </style>

    <text x="30.5" y="28.9" text-anchor="start" class="timeIt">
       ${timeIt} 
    </text>

    <text x="100%" y="142.5" class="dateTimeAndTradingcode" text-anchor="end">
        <tspan dx="-21">
            ${paytime}
        </tspan>
    </text>

    <text x="262" y="142.5" text-anchor="start" class="dateTimeAndTradingcode">
       ${paydate} 
    </text>

    <text x="100%" y="157.5" class="dateTimeAndTradingcode" text-anchor="end">
      <tspan dx="-21">
        ${tradingCode}
      </tspan>
    </text>

    <text x="31" y="201.5" class="transferSuccess" text-anchor="start">
        ${"Chuyn tin lin ngn hng thnh cng!"}
    </text>

    <text x="100%" y="281" class="transferAccout" text-anchor="end">
        <tspan dx="-25">
            ${transferAccout}
        </tspan>
    </text>

    <text x="100%" y="300" class="transferUser" text-anchor="end">
        <tspan dx="-25"> 
            ${transferUser}
        </tspan>
    </text>

    <text x="100%" y="331" text-anchor="end" class="receiveUser">
        <tspan dx="-25"> 
            ${receiveUser}
        </tspan>
    </text>

    <text x="100%" y="350" class="receiveAccout" text-anchor="end">
        <tspan dx="-25"> 
            ${receiveAccout}
        </tspan>
    </text>

    <foreignObject x="154" y="368" width="196" height="36">
        <div xmlns="http://www.w3.org/1999/xhtml" class="reveiveBank">                  
            ${reveiveBank}
        </div>
    </foreignObject>

    <text x="100%" y="431.5" text-anchor="end" class="transferMoney">
       <tspan dx="-25">${transferMoney}</tspan>
       <tspan dx="0">${"VND"}</tspan>
    </text>

    <text x="100%" y="450.5" text-anchor="end" class="tranferMoneyText">
       <tspan dx="-25">${tranferMoneyText}</tspan>  
    </text>

    <text x="100%" y="481.5" text-anchor="end" class="fee">
       <tspan dx="-25">${"Min ph"}</tspan>  
    </text>

    <foreignObject x="199" y="504.5" width="151.5" height="36">
        <div xmlns="http://www.w3.org/1999/xhtml" class="contentbank">                  
            ${contentbank}
        </div>
    </foreignObject>
    ${rightStatusBar}

</svg> `;
